window.bookSummaryJSON = "<p>When those inside the corridors of power need help outside the law, they know who to call. Jonathan Grave, covert rescue specialist, always gets results. No names. No feds. No trace evidence.</p> <p>When an Indiana college student is abducted, Jonathan and his team of ace operatives unravel a deadly scheme the government wants ignored. Someone wants to control a devastating secret. Someone rich, powerful, and willing to kill anyone to get it. Even the people Jonathan loves most.</p>"; 
